(function($,karmaBuilder){karmaBuilder.elementPanel=Backbone.View.extend({events:{"click .element-panel-add-element-button":"openAddElementView","click ":"stopClickInPanel"},initialize:function(){this.setElement($('<div class="karma-element-panel-container">'));this.render();this.createAddElementPanel();this.createTemplatesPanel();this.createUnsplashPanel();this.closeElementPanel()},stopClickInPanel:function(e){e.stopPropagation()},render:function(){document.body.appendChild(this.el)},createAddElementPanel:function(){var templateParams={};templateParams["elementInfo"]=KarmaView.getElementInfo();var template="<div>"+KarmaView.getWpTemplate("karma-element-panel-add-element",templateParams)+"</div>";this.el.appendChild($(template)[0]);$(document).trigger("karma_finish_element_panel_html",[this])},createTemplatesPanel:function(){var template="<div>"+KarmaView.getWpTemplate("karma-element-panel-templates",{})+"</div>";this.el.appendChild($(template)[0]);$(document).trigger("karma_finish_element_panel_html",[this])},createUnsplashPanel:function(){var template="<div>"+KarmaView.getWpTemplate("karma-element-panel-unsplash",{})+"</div>";this.el.appendChild($(template)[0]);$(document).trigger("karma_finish_element_panel_html",[this])},openAddElementView:function(){var addElement=document.querySelector(".karma-element-panel-add-element-view");if(null!=addElement){addElement.classList.add("element-panel-show")}},closeElementPanel:function(){$(document).on("click",function(){var addElement=document.querySelector(".karma-element-panel-add-element-view");if(null!=addElement){addElement.classList.remove("element-panel-show")}})}})})(jQuery,karmaBuilder);